import React , { useState } from "react";
import Profil from "./Profil";
import Right from "./Right";
import Default from "./Defult";
import userContext from "./userContext";
import prodect from "./data";



export default function Body(){
    let [reduce,setreduce]=useState([])
    let [data,setdata]=useState()
    let [chang ,setchange]=useState(false)
    let [order,setorder]=useState([])
    let [delet,setdel]=useState('')
    let [swich,setswich]=useState(false)

    let { item }=prodect;
   


    let addOrder=(element)=>{
        setorder([...order,element])
        setdel('') 
        }
    let looping=(el)=>{
        setreduce([...reduce,el])
        
        console.log(item)
         

    }
    
    
    

    
    return (
        <div className="body">
           
           {chang ? <Right column='4/6' rows='1/6' swich={setswich} sendReduce={reduce} getorder={order}  dele={setorder}  pdata={data}/> : <Default  column='4/6' rows='1/6'/> }
            
            
            <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping} info={[{
               id:1,
               column:'1' ,
                rows:'1' ,
                image:'/image/image-waffle-desktop.jpg' , 
                thename:"Waffle" ,
                discrption:'Waffle with Berries' ,
                slarey:'6.50',
                class:'order' 
               }]}
                
                
            />
            
            <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping} info={{
                id:2,
                column:'2'  ,
                rows:'1' ,
                image:'/image/image-creme-brulee-desktop.jpg'  ,
                thename:"Crème Brûlée" ,
                discrption:'Vanilla Bean Crème Brûlée', 
                slarey:'7.00' ,
                class:'order',
            }}
                
            />
             
             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
                id:3,
                column:'3',  
                rows:'1',
                image:'/image/image-macaron-desktop.jpg' , 
                thename:"Macaron" ,
                discrption:'Macaron Mix of Five' ,
                slarey:'8.00' ,
                class:'order'
             }}
             
                /> 

             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
                id:4,
                column:'1'  ,
                rows:'2' ,
                image:'/image/image-tiramisu-desktop.jpg'  ,
                thename:"Tiramisu" ,
                discrption:'Classic Tiramisu' ,
                slarey:'5.50', 
                class:'order' 
             }} 
               /> 

             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
                id:5,
                column:'2'  ,
                 rows:'2' ,
                 image:'/image/image-baklava-desktop.jpg'  ,
                 thename:"Baklava" ,
                 discrption:'Pistachio Baklava' ,
                 slarey:'4.00' ,
                 class:'order'
             }}
            /> 

            <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
               id:6,
               column:'3'  ,
                rows:'2' ,
                image:'/image/image-meringue-desktop.jpg'  ,
                thename:"Pie" ,
                discrption:'Lemon Meringue Pie' ,
                slarey:'5.00' ,
                class:'order' 

            }}
                 /> 

             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
                id:7,
                column:'1'  ,
                rows:'3' ,
                image:'/image/image-cake-desktop.jpg'  ,
                thename:"Cake" ,
                discrption:'Red Velvet Cake', 
                slarey:'4.50' ,
                class:'order'
             }}
                  /> 

             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}   info={{
                id:8,
                column:'2'  ,
                rows:'3' ,
                image:'/image/image-brownie-desktop.jpg'  ,
                thename:"Brownie" ,
                discrption:'Salted Caramel Brownie' ,
                slarey:'5.50' ,
                class:'order' 
             }}
             /> 

             <Profil changdiv={setchange} swich={setswich} getswith={swich} order={addOrder} data={setdata} redu={looping}  info={{
                id:9,
                column:'3' , 
                rows:'3' ,
                image:'/image/image-panna-cotta-desktop.jpg'  ,
                thename:"Panna Cotta" ,
                discrption:'Vanilla Panna Cotta' ,
                slarey:'6.50' ,
                class:'order' 
             }}

             /> 
            
            

        </div>
    );
}
